

select * from dbo.zz_import_20100520_PatientRecord

alter table zz_import_20100520_PatientRecord add rowId int identity(1,1)


--insert into vendorImport( VendorName, VendorFormat, DateCreated, Notes)
--values( 'Custom', 'xls', getdate(), 'sf 115619')

	INSERT INTO [dbo].[Patient](
		prefix,
		Suffix,
		MiddleName,
		[PracticeID],
		[FirstName],
		[LastName],
		[AddressLine1],
		[AddressLine2],
		[City],
		[State],
		[ZipCode],
		[HomePhone],
		HomePhoneExt,
		WorkPhone,
		WorkPhoneExt,
		MobilePhone,
		[DOB],
		SSN,
		[Gender],
		[VendorID],
		MedicalRecordNumber,
		VendorImportID,
		CollectionCategoryID,
		DefaultServiceLocationID,
		PrimaryProviderID,
		EmailAddress,
		EmploymentStatus,
		EmployerID,
		MaritalStatus,
		
		
      [ResponsibleDifferentThanPatient]
      ,[ResponsiblePrefix]
      ,[ResponsibleFirstName]
      ,[ResponsibleMiddleName]
      ,[ResponsibleLastName]
      ,[ResponsibleSuffix]
      ,[ResponsibleRelationshipToPatient]
      ,[ResponsibleAddressLine1]
      ,[ResponsibleAddressLine2]
      ,[ResponsibleCity]
      ,[ResponsibleState]
      ,[ResponsibleCountry]
      ,[ResponsibleZipCode]
		)
		
	select
	    ["pat_name_prefix"],
	    ["pat_name_sfx"],
	    ["pat_name_mi"],
	    1 as practiceId,
	    ["pat_name_first"],
	    ["pat_name_last"],
	    ["pat_addr_1"],
	    ["pat_addr_2"],
	    ["pat_city"],
	    ["pat_state"],
	    ["pat_zip_code"],
	    replace(replace(replace(["phone_nbr"],'(',''), ')', ''), '-', ''),
	    ["home_phone_ext"],
	    replace(replace(replace(["emp_phone_nbr"],'(',''), ')', ''), '-', ''),
	    ["emp_phone_ext"],
	    null as mobilePhone,
	    ["birthdate"],
	    replace(["pat_ssn"], '-', '') as pat_ssn,
	    ["sex"],
	    rowID as vendorID,
	    ["unit_nbr"] as medicalRecordNumber,
	    1 as vendorImportID,
	    1 as collectionID,
	    null,
	    null as primaryProviderID,
	    ["email_address"],
	    null as empStatus,
	    null as EmpId,
	    case ["marital_status_cd"]
			when 'X' then 'U'
			else  ["marital_status_cd"] end as MartialStatus,

      0 as  [ResponsibleDifferentThanPatient]
      ,["guar_name_prefix"] as [ResponsiblePrefix]
      ,["guar_name_first"] [ResponsibleFirstName]
      ,["guar_name_mi"] [ResponsibleMiddleName]
      ,["guar_name_last"] as [ResponsibleLastName]
      ,["guar_name_sfx"] as [ResponsibleSuffix]
      ,case ["guar_rel_code"] when 'S' then 'S'
			when 'F' then 'C'
			when 'L' then 'O'
			when 'M' then  'C' end as [ResponsibleRelationshipToPatient]
      ,["guar_addr_1"] [ResponsibleAddressLine1]
      ,["guar_addr_2"] [ResponsibleAddressLine2]
      ,["guar_city"] [ResponsibleCity]
      ,["guar_state"] [ResponsibleState]
      ,["guar_country"] [ResponsibleCountry]
      ,["guar_zip_code"] [ResponsibleZipCode]
	from dbo.zz_import_20100520_PatientRecord
	
		
	INSERT INTO [dbo].[Employers](
		[EmployerName]
		,[AddressLine1]
		,[AddressLine2]
		,[City]
		,[State]
		,[ZipCode]
		)
	select distinct
	["emp_name"],
	["emp_addr_1"],
	["emp_addr_2"],
	["emp_city"],
	["emp_st"],
	["emp_zip"]
	from dbo.zz_import_20100520_PatientRecord
	where ["emp_name"] <> ''
	
	
	
	alter table zz_import_20100520_PatientRecord add employerID int
	
	update z
	set employerID=e.employerID
	from zz_import_20100520_PatientRecord z
		inner join employers e
			on 	["emp_name"]=EmployerName and
			["emp_addr_1"]=AddressLine1 and
			["emp_addr_2"]=AddressLine2 and
			["emp_city"]=City and
			["emp_st"]=State and
			["emp_zip"]=ZipCode
	
	update p
	set employerID=z.employerID
	from zz_import_20100520_PatientRecord z
		inner join patient p
			on p.vendorID=z.rowID
			
			
			
			
			

