alter table dbo.zz_import_20100520_insurance_record add insuranceCompanyID INT


update z
set insuranceCompanyID=null
from dbo.zz_import_20100520_insurance_record z


update z
set insuranceCompanyID=ic.insuranceCompanyID
from dbo.zz_import_20100520_insurance_record z
	inner join insuranceCompany ic
		on 
		 [insurance_company_name] =InsuranceCompanyName
      and [carrier_address_1]=ic.AddressLine1
      and [carrier_address_2]=ic.AddressLine2
      and [carrier_city]=ic.City
      and [carrier_state]=ic.State
      and [carrier_zipcode]=ic.ZipCode
GO




