alter table zz_import_20100520_insurance_record add insuranceCompanyPlanID int


update z
set insuranceCompanyPlanID=ic.insuranceCompanyPlanID
from dbo.zz_import_20100520_insurance_record z
	inner join insuranceCompanyPlan ic
		on 
		 insurance_plan_name =PlanName
      and [carrier_address_1]=ic.AddressLine1
      and [carrier_address_2]=ic.AddressLine2
      and [carrier_city]=ic.City
      and [carrier_state]=ic.State
      and [carrier_zipcode]=ic.ZipCode
      and z.insuranceCompanyID=ic.insuranceCompanyID
GO






	-- delete [PatientCase] where vendorImportID=1
	-- Primary
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorImportID
		,VendorID
		   )
	select
		patientID,	
		'Default Insurance Case',
		1,
		5,
		951,
		951,
		practiceID,
		VendorImportID,
		p.vendorID 
	from patient p
	where vendorID IN (
		select zp.rowID
		from dbo.zz_import_20100520_insurance_record zi
			inner join dbo.zz_import_20100520_PatientRecord zp
				on zp.["unit_nbr"]=zi.[unit_nbr]
		and insuranceCompanyPlanID is not null
	)
				

alter table zz_import_20100520_insurance_record add rowid int identity(1,1)
		
		
	-- delete InsurancePolicy where vendorImportID=1
	insert into dbo.InsurancePolicy(
		PatientCaseID
		,InsuranceCompanyPlanID
		,Precedence
		,PolicyNumber
		,GroupNumber

		,CardOnFile
		,PatientRelationshipToInsured
		,HolderThroughEmployer
		,PatientInsuranceStatusID
		,VendorID
		,VendorImportID
		,PracticeID
	)
	select 
		pc.PatientCaseID
		,zi.InsuranceCompanyPlanID
		,row_number() over(partition by patientCaseId order by seq_nbr )
		,policy_nbr
		,group_nbr
		,0 as CardOnFile
		,'S' as PatientRelationshipToInsured
		,0 as HolderThroughEmployer
		,0 as PatientInsuranceStatusID
		,(zi.rowID) as VendorID
		,1 as VendorImportID
		,1 as PracticeID
		from Patient p
			inner join dbo.zz_import_20100520_PatientRecord zp
				on zp.rowId=p.vendorID
			inner join dbo.zz_import_20100520_insurance_record zi
				on zp.["unit_nbr"]=zi.[unit_nbr]			
				and zi.insured_party_name_mi=zp.["pat_name_first"]
				and zi.insured_party_name_first =zp.["pat_name_last"]	
			inner join PatientCase pc (nolock)
				on pc.patientID=p.patientID
	where p.vendorImportID=1
		and InsuranceCompanyPlanID is not null
	--group by 
	--	pc.PatientCaseID
	--	,zi.InsuranceCompanyPlanID
	--	,policy_nbr
	--	,group_nbr
	order by pc.PatientCaseID, 3


